		<h1>67 終わりなき尻いじめ</h1>

		<table width="760">
			<tr>
				<td>
					<p style="font-size: 24px">「ケツの穴犯されて悦んじゃって…　ホントどうしようもない変態女ね。
						こんないやらしいお尻は、もっと徹底的にお仕置きしなきゃね！」<br>
						　まだまだ続く肛門リンチ…　アニスの魅力的な美しいお尻は、既に愛弟子達の玩具と成り下がっていた。</p>
